import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const departments = ['Department 1', 'Department 2', 'Department 3', 'Department 4', 'Department 5'];

  return (
    <nav className="bg-gray-800 py-4">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center">
          <div className="flex space-x-4">
            {departments.map((department) => (
              <Link key={department} to={`/department/${department.toLowerCase().replace(' ', '-')}`} className="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-medium">
                {department}
              </Link>
            ))}
          </div>
          <div>
            <Link to="/feedback" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
              Feedback
            </Link>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
